package basic_004;
//write a java code to print odd numbers from 35 to 65
public class A009_whileloop_odd_35_65 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=35;
		while (i<=65) {
			if (i%2!=0) {
				System.out.println(i);
				
			}i++;
			
		}

	}

}
